import axios from 'axios';
import { cloudEndpoints } from './endpoints';
export const createDeployment = async (request) => {
    const { apiKey, ...body } = request;
    const { data } = await axios.post(cloudEndpoints.createDeployment, body, {
        headers: {
            'x-api-key': apiKey,
        },
    });
    return data;
};
